import React from "react";

function FormInput (props) {
    return (
        <React.Fragment> 
            <label>
             <span> {props.label} </span>
             <input type={props.type} name={props.name} placeholder={props.placeholdertext}> </input>
            </label>
        </React.Fragment>
    );
}

export default FormInput;
